function parseURL(url = '/test/test.jpg') {


    let regex = /^((http[s]?|ftp):\/)?\/?([^:\/\s]+)(:(\d+))?((\/\w+)*\/)([\w\-\.]+[^#?\s]+)(.*)?(#[\w\-]+)?$/gm;

    let info = match(regex, url);
    let baseURL = {};
    baseURL['protocol'] = info[2];
    baseURL['host'] = info[3];
    baseURL['port'] = info[5];
    baseURL['path'] = info[6];
    baseURL['file'] = info[8];
    baseURL['params'] = {};

    regex = /(\?|\&)([^=]+)\=([^&]+)/gm;
    info = match(regex, url);

    for (let i = 2; i < info.length; i += 2)
        baseURL['params'][info[i]] = info[i + 1];
    return baseURL;


}

